import React, { Component } from 'react'

export class Audi extends Component {
    render() {
        return (
            <div>
                <div className="container-fluid">
                    <div className="row">   
                        <img className="col-lg-3" src="" /><div className="col-lg-9"></div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Audi
